window.bookSummaryJSON = "<p>Falling in love changes everything. </p> <p>Three bad things I learned this year: </p> <p></p> <ul> <li>People you trust lie, even parents. </li> <li>That hot guy, the one who's totally into you, might not be the one. </li> <li>Things are not always how they appear. </li> </ul> <p></p> <p>Three good things I learned this year: </p> <p></p> <ul> <li>Best friends are always there for you, even when they're far away. </li> <li>That other hot guy, the one who remembers your birthday, just might be the one. </li> <li>Oh, and things are not always how they appear. </li> </ul> <p></p> <p>Anna Sanders expected an anonymous (and uneventful) senior year until she crossed paths with rich and sexy Jack Kyser and his twin sister, Lucy. Pulling Anna into their extravagant lifestyle on the Gulf Coast, Lucy pushed Anna outside her comfort zone, and Jack showed her feelings she'd never experienced - until he mysteriously withdrew. </p> <p>Anna turned to her internship at the city paper and to her old attraction to Julian, a handsome local artist and rising star, for distraction. But both led to her discovery of a decades-old secret closely guarded by the twins' distant, single father. </p> <p>A secret that could permanently change all their lives. </p>"; 
